tables.table_schema:
CREATE TABLE therapists (
	therapist_id INT PRIMARY KEY,
	name VARCHAR(50),
	department VARCHAR(50),
	search_tags TEXT
);

CREATE TABLE Therapists (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    specialization VARCHAR(255),
    location VARCHAR(255)
);

CREATE TABLE Medications (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    dosage VARCHAR(50),
    usage_instructions TEXT
);
